import React from 'react';
import VideoItem from './VideoItem';

function VideoList({videos}) {
    return(
        <div>
            <h1>Video List : {videos.length}</h1>
            {
            videos.map(
                (video) => 
                    <VideoItem key={videos.id}/>
            )}
            

        </div>
    );
}
export default VideoList;
